                        "title": " All about WildFly, Only using demos",
                        "sessionsMaterialUrl": "http://peterkellner.net",
                        "description": " WildFly 8 (née JBoss Application Server) is Red Hat's open source Java\nEE 7 compliant application server. It contains robust implementations\nof WebSocket, Batch, JSON, Concurrency, JMS2, JAX-RS 2, CDI 1.1, and\nall Java EE 7 technologies. Undertow is the new cutting-edge web\nserver in WildFly 8 and is designed for maximum throughput and\nscalability, including environments with over a million connections.\nThe number of ports is reduced by multiplexing protocols over HTTP\nusing HTTP Upgrade.\n\nRole Based Access Control support organizations with separated\nmanagement responsibilities and restrictions. Roles represent\ndifferent sets of permissions such as runtime operation execution,\nconfiguration areas that can read or written, and the ability to audit\nchanges and manage users. In addition a new restricted audit log can\nbe enabled including the ability to offload to a secure syslog server.\nIt also provides a rich web-based administration console and a\npowerful CLI for management. Multi instance cluster with high\navailability can be easily created.\n\nYou don't even need to download WildFly in order to experience this\nfunctionality. Applications can be directly deployed to OpenShift, Red\nHat's open source PaaS offering.\n\nThis session will provide an overview of all these features using\nseveral live demos.",
