                        "title": " MongoDB + Vert.x = Red Hot goodness",
                        "sessionsMaterialUrl": "",
                        "description": "Vert.x is a polyglot async ready application server that runs on the JVM. It comes with a built in Event Bus and uses JSON for message passing. That use of JSON makes for some very interesting integration pieces with MongoDB. In this talk I will start by introducing some of the basic concepts of Vert.x, such as Verticles, EventBus, and a ton of built in features. From there I will demonstrate how easy it is to run a WebSocket enabled application that provides live tracking map of airplane flights. The code will be a mix of JavaScript, Java, and Python to flex some polyglotness. Then with a few lines of code I will demonstrate how easy it is to push the same feed of data straight into a spatially enabled MongoDB instance. Given the way both plaforms are such a close fit, I will show how easy it is to also add a REST query service right on top of the API. Don't let all the Node.JS hipsters have all the fun - come see the exciting possibilities for JavaScript or Java application with Vert.x and MongoDB. ",
                        "descriptionShort": "Vert.x is a polyglot async ready application server that runs on the JVM. Don't let all the Node.JS hipsters have all the fun - come see the exciting possibilities for JavaScript or Java application with Vert.x and MongoDB. ",
