                        "title": ".Net Distributed Caching",
                        "sessionsMaterialUrl": "http://fryerblog.com/post/99933007601/net-distributed-caching",
                        "description": "As part of a platform modernization strategy within Fiserv we have been moving to architectures that use distributed cache for state to keep our web and worker machines stateless. This is an important enabler for systems that use auto scaling patterns. We have built an abstraction interface on top of several cache providers we evaluated. This gives us a common model for analyzing performance data, like TPS. We open sourced some of this work into a library called CacheSharp (on Github and NuGet). In this session we’ll show you how we run tests against several providers, establish a baseline of data, and compare the results. This is something you should be able to take back to your dev shop and get started with in an afternoon.",
                        "descriptionShort": "Distributed caching is an important enabler for stateless architectures that leverage modern patterns like auto scaling. In this session we’ll look at several .Net cache providers and share some practical ways to get started with them now.",
