                        "title": "Agile at Enterprise Scale: Flipping Sticky Bits",
                        "sessionsMaterialUrl": "http://slidesha.re/15OnhuG",
                        "description": "Want to build a high performing business at enterprise scale? Agile thrives with individual teams, yet even Ken Schwaber asserts 75% of organizations using scrum won't succeed in getting the benefits they hope for from it. Many such organizations have been structured by default along hierarchical lines, rather than by design for iterative work. A set of established and emerging ideas to address organizational impediments point to a future where Agile introductions Go Big, rather than Go Home. Not simply theory, this session will overlay these ideas onto a real world example of a hw/sw business that scaled from break even to $1B+ in 4y. Come learn which Sticky Bits to Flip to successfully run Agile at Enterprise Scale.",
