                        "title": "An Introduction to using Apache Spark for Machine Learning ",
                        "sessionsMaterialUrl": "",
                        "description": "<p>Apache <a href=\"http://spark.apache.org/\">Spark</a> is a fast distributed processing engine written in Scala with additional support for Java and Python.</p>\n\n<p>The core data structure of Spark is a Resilient Distributed DataSet that provides fast and flexible in-memory processing yet with support for massive datasets and fault tolerance by running on top of Hadoop/HDFS (and lately additional scalable backends, notably Cassandra). </p>\n\n<p>Spark includes several Modules on top of its Core: this talk will focus on Spark MLLib which is a machine learning library on top of Spark Core. MLLib leverages the memory-resident capabilities of Spark to enable fast implementations of iterative algorithms in ways that are not possible with traditional Map/Reduce on top of Hadoop. </p>\n\n<p>This talk will briefly describe the Spark Core and MLLib architectures and then switch focus into the Scala language implementation of examples in the following areas: Classification Regression Clustering (If time allows: Collaborative Filtering and Feature Selection) Additionally SparkSQL will be briefly discussed and then used to examine some of the results. </p>\n\n<p>This talk will assume working knowledge of scala functional programming methods and constructs.</p>",
                        "descriptionShort": "Apache Spark is a fast distributed processing engine written in Scala and running atop Hadoop. This talk will describe the Spark MLLib library and then dive in to coding examples in Classification, Clustering, and Feature Selection",
                        "confRegistrationLine": "",
                        "createDate": "2014-07-16T12:32:01.663Z",
                        "updateDate": "2014-07-15T15:33:45Z",
                        "sessionLevelId": 2,
                        "sessionCategoryId": 12,
                        "notesToSpeaker": "",
                        "sessionTimeCustom": "",
                        "sessionTimeDateTime": "2014-10-11T09:45:00",
                        "sessionTimeDateTimeString": "2014-10-11T09:45:00",
                        "descriptionFirstParagraph": "<p>Apache <a href=\"http://spark.apache.org/\">Spark</a> is a fast distributed processing...",
                        "descriptionAfterFirstParagraph": " engine written in Scala with additional support for Java and Python.</p>\n\n<p>The core data structure of Spark is a Resilient Distributed DataSet that provides fast and flexible in-memory processing yet with support for massive datasets and fault tolerance by running on top of Hadoop/HDFS (and lately additional scalable backends, notably Cassandra). </p>\n\n<p>Spark includes several Modules on top of its Core: this talk will focus on Spark MLLib which is a machine learning library on top of Spark Core. MLLib leverages the memory-resident capabilities of Spark to enable fast implementations of iterative algorithms in ways that are not possible with traditional Map/Reduce on top of Hadoop. </p>\n\n<p>This talk will briefly describe the Spark Core and MLLib architectures and then switch focus into the Scala language implementation of examples in the following areas: Classification Regression Clustering (If time allows: Collaborative Filtering and Feature Selection) Additionally SparkSQL will be briefly discussed and then used to examine some of the results. </p>\n\n<p>This talk will assume working knowledge of scala functional programming methods and constructs.</p>",
