                        "sessionsMaterialUrl": "https://github.com/DeborahK/Angular-MovieHunter-WebAPI",
                        "description": "Angular is what HTML would have been had it been designed to build web applications. This session provides JavaScript developers with a quick start to building Web applications with AngularJS.\n \nThe session begins with a gentle, acronym-free overview of Angular, its purpose and benefits. Then using only a simple text editor, such as Notepad, and a browser, the developer will learn how to incorporate basic Angular features such as directives, expressions, filters, and data binding into a basic Web page.\n \nThe second half of the session introduces WebStorm as a development tool and expands the Web page into a Single Page Application (SPA). In small and deliberate steps, the developer will learn how to create a controller, two user interface views, and the routing required to switch between the two views.",
