                        "title": "Azure for Open Source Developers",
                        "sessionsMaterialUrl": "",
                        "description": "What could Microsoft's cloud platform Azure do for open source developers?  As it turns out, lots.  Come see how to deploy your Node, Python, Java, and PHP apps to Azure Web Sites, a PaaS offering.  Learn how to use other Azure components such as storage, databases, queues, and more.  Want to run Linux virtual machines?  You can do that too.  All demos will be done from a Mac to prove that Azure is a great place for non-Windows developers too.",
                        "descriptionShort": "Learn how to use Node, Python, and other OSS technologies on Azure, Microsoft's cloud platform.",
                        "confRegistrationLine": "",
