                        "title": "Azure Virtual Machines (IaaS in the Microsoft cloud)",
                        "sessionsMaterialUrl": "",
                        "description": "Microsoft Azure Virtual Machines is the IaaS offering in the Azure Platform. It supports the deployment of both Windows Server and Linux VMs workloads into an Azure datacenter. Azure Virtual Machines can be used to create sophisticated applications that take advantage of the scalability and availability features provided by Azure. In this session, Neil will provide an in-depth review of Azure Virtual Machines and describe some best practices in deploying applications into Azure Virtual Machines.",
