                                    "bio": "Jerry is a Developer Evangelist for Microsoft, teaching and speaking on Windows, Phone, and Desktop. Seasoned in Colorado, his career launched with Microsoft SQL Server 6.5 – he was delivering data-centric solutions while “database developer” was a novel term. He received a civilian Naval Commendation for security work, preceding his work for the Start Up that become Microsoft CRM. The bulk of Jerry's work targeted insurance and finance, especially not-for-profits. For 15 years, he built Microsoft-centric solutions and mobile apps. Today, Jerry speaks on XAML, mobility and Kinect at events, communities, and schools – influencing another generation of excellent, Microsoft developers. To that end, most of Jerry’s free time is spent teaching his three daughters Star Trek character backstories and episode plots.",
