                        "title": "Build Your First iOS App",
                        "sessionsMaterialUrl": "",
                        "description": "Ever wanted to build your own app; well here is your chance! In this class you\nwill learn how to create a simple game using Xcode, you will find out about different tools to build iOS apps, and the steps needed to publish an iOS app. You will learn how to switch between multiple screens, how to add images, and make a basic user interface. This is a great way to be introduced into the world of iOS programming, and with all of these resources, you can continue to learn and build even more apps at home. Make sure that if you have a Mac then bring it with Xcode installed and you must be willing to share your laptop with people who don’t have a Mac.",
