                        "title": "Business of App Development",
                        "sessionsMaterialUrl": "www.tobiahmarks.com",
                        "description": "What do you need to know to make a successful mobile game company? It's the number one question asked to Tobiah Marks, most known for \"Blast Monkeys\" a physics based puzzle game that was the #1 app on Android. You already know you need to think about things like monetization, but did you know file size can be an even more important factor? Tobiah will explain his philosophy on how to out maneuver your competition using real world examples. His advice can be applied to app development on all platforms.",
                        "descriptionShort": "What makes some apps rise up the charts and others flop? Learn the tricks you need to know to out maneuver your competition.",
