                        "sessionsMaterialUrl": "http://www.club.cc.cmu.edu/~ajo/disseminate/cppcon/",
                        "description": "Three techniques from a production C++11 codebase. <br>\nThe Auto() macro allows writing arbitrary end-of-scope cleanup code\nin-line, with zero boilerplate and zero runtime overhead. <br>\nmake_iterable() (alias boost::iterator_range) takes a pair of\niterators and turns them back into a \"container\" usable in C++11's\nranged for loop. <br>\nstd::spaceship (not actually part of the standard) implements a\nPerl-style <=> operator in a maximally efficient way for C++11 tuples.",
                        "descriptionShort": "Techniques from MemSQL's C++11 codebase. The Auto() macro is the next evolution of OnScopeExit(). make_iterable (a.k.a. as_range) allows \"viewing\" an arbitrary range as if it were a container. StringConverter. std::spaceship.",
