                        "approved": true,
                        "adminComments": "",
                        "title": "Clean Code I - Best Practices",
                        "sessionsMaterialUrl": "http://speakerrate.com/talks/38001-clean-code-i-best-practices",
                        "description": "All Clean Code presentations provide great value by themselves, but taken together are designed to offer a holistic approach to successful software creation. This first session creates the foundation for the 2nd Clean Code presentation on Dependency Injection, as it explains expected base knowledge. \n\nWhy writing Clean Code makes us more efficient Over the lifetime of a product, maintaining the product is actually one - if not the most - expensive area(s) of the overall product costs. The Craftsmanship session is exploring the often underestimated importance of clean execution of the coding part and its crucial impact to overall project success. Writing clean code can significantly lower these costs. \n\nHowever, writing clean code also makes you more efficient during the initial development time and results in more stable code. You will be presented design patterns and best practices which will make you write better and more easily maintainable code, seeing code in a holistic way. \n\nYou will learn how to apply them by using an existing implementation as the starting point of the presentation. Finally, practices benefits are explained. \n\nThis presentation is based on C# and Visual Studio 2013. However, the demonstrated patterns and practice can be applied to every other programming language too.",
