                        "adminComments": "",
                        "title": "Clean Code II - Cut your Dependencies with Dependency Injection ",
                        "sessionsMaterialUrl": "http://tinyurl.com/npc9njb",
                        "description": "All Clean Code presentations provide great value by themselves, but taken together are designed to offer a holistic approach to successful software creation. This first session creates the foundation for the 2nd Clean Code presentation on Dependency Injection, as it explains expected base knowledge. \n\nWhy writing Clean Code makes us more efficient Over the lifetime of a product, maintaining the product is actually one - if not the most - expensive area(s) of the overall product costs. The Craftsmanship session is exploring the often underestimated importance of clean execution of the coding part and its crucial impact to overall project success. \n\nWe will dive into the basics of Inversion of Control (IOC) and Dependency Injection (DI) to review different ways of achieving decoupling, using and exploring both: Best Practices, Design and Anti Patterns. \n\nThis presentation requires knowledge and understanding of basics like DRY, SoC, SRP, SOLID etc. which are building the base for decoupled architecture. However, we will start at the basics of DI and will work towards intermediate and advanced scenarios depending on the participating group. \n\nThis presentation is based on C# and Visual Studio 2013. However, the demonstrated patterns and practice can be applied to every other programming language too.",
                        "descriptionShort": "We will dive into the basics of Inversion of Control (IOC) and Dependency Injection (DI) to review different ways of achieving decoupling, using and exploring both: Best Practices, Design and Anti Patterns. ",
                        "confRegistrationLine": "",
                        "createDate": "2014-08-25T08:36:10.1Z",
                        "updateDate": "2014-08-24T04:37:06Z",
                        "sessionLevelId": 2,
                        "sessionCategoryId": 13,
                        "notesToSpeaker": "",
                        "sessionTimeCustom": "",
                        "sessionTimeDateTime": "2014-10-11T11:15:00",
                        "sessionTimeDateTimeString": "2014-10-11T11:15:00",
                        "descriptionFirstParagraph": "All Clean Code presentations provide great value by themselves, but taken together are...",
                        "descriptionAfterFirstParagraph": " designed to offer a holistic approach to successful software creation. This first session creates the foundation for the 2nd Clean Code presentation on Dependency Injection, as it explains expected base knowledge. \n\nWhy writing Clean Code makes us more efficient Over the lifetime of a product, maintaining the product is actually one - if not the most - expensive area(s) of the overall product costs. The Craftsmanship session is exploring the often underestimated importance of clean execution of the coding part and its crucial impact to overall project success. \n\nWe will dive into the basics of Inversion of Control (IOC) and Dependency Injection (DI) to review different ways of achieving decoupling, using and exploring both: Best Practices, Design and Anti Patterns. \n\nThis presentation requires knowledge and understanding of basics like DRY, SoC, SRP, SOLID etc. which are building the base for decoupled architecture. However, we will start at the basics of DI and will work towards intermediate and advanced scenarios depending on the participating group. \n\nThis presentation is based on C# and Visual Studio 2013. However, the demonstrated patterns and practice can be applied to every other programming language too.",
