                        "title": "Code Shaming, Anti Patterns in Action",
                        "sessionsMaterialUrl": "http://www.slideshare.net/masimms/svcc-code-shaming-and-antipatterns",
                        "description": "As part of my job at Microsoft helping our customers build out highly awesome solutions on Azure, I see a lot of code.  Some good, some bad, some so tremendously awkward (often in very subtle ways) that I ran away screaming.\n\nIn this session we'll explore some (highly anonymized) examples of anti patterns in action, and how to identify and address several of these patterns in the context of cloud services at scale.\n\nDisclaimer: there will be humor, sarcasm, and a fair bit of bad code written by yours truly.",
