                        "title": "Creating HTML5-based Apps for Wearable Technologies",
                        "sessionsMaterialUrl": "http://www.slideshare.net/ocampesato/svcc-2014html5g-glass",
                        "description": "This session focuses on developing Glassware (apps for Google Glass) using the GDK and the Miror API. You'll learn about the MyGlass app and its ability to screencast from Glass, and how to pair Glass with an Android tablet and iOS devices.\n\nYou will see code samples from an upcoming Google Glass book (Q3/2014), such as CSS3 2D/3D graphics and animation effects, HTML5 Canvas, and D3, all of which will be deployed to a Glass device.\n\nIf time permits, some code samples for other wearable devices will be presented.\nThis session is intended for people who have some familiarity with HTML and Eclipse. Bring your Glass device (or share with someone) to derive the maximum benefit from the presentation, which concludes with a book raffle of recent books (published in 2013 and 2014 by Mercury Learning).\n",
