                        "title": "Data Visualization Using Pov-Ray 3.7",
                        "sessionsMaterialUrl": "http://tinyurl.com/oobdwnr",
                        "description": "Pov-Ray is a free software tool used for creating stunning three-dimensional graphics - both static images and animations. It has evolved over many years and can be used to generate stunning scenes such as those found here: http://hof.povray.org. What if you could take your own data sets and build dynamic scene definitions to portray your data? During this session, I'll show what I've done to accomplish this, and progress I've made towards making it available generally as a visualization engine that's accessible to anyone, no matter your preferred database or data tools.",
                        "descriptionShort": "Data visualization using 3 and 4 dimensional strategies will be explored using a free ray tracing engine.",
