                        "approved": true,
                        "adminComments": "",
                        "title": "Debunking The Agile Myth:  Agile is NOT Just for Software!",
                        "sessionsMaterialUrl": "",
                        "description": "Time has proven that Agile development has provided huge gains for software development.  But what about organizations & teams that deliver a mixed-platform (Hardware/Software/Firmware) product to their customers?  Typically these companies have separate teams using different development processes - and it all has to fit together to deliver the best product to your customer.\n\nI see companies struggle with this issue, and many times miss schedule commitments and customer expectations.  With all the progress in the application of Agile methodologies to software development, we wondered what are the most effective tools in the Agile Software toolkit? Can these tools be applied to hardware and other types of product development programs? These questions were the focus of a 2013 study of Silicon Valley technology firms. \n\nOur research found that the most impactful elements of Agile/Scrum were not unique to software development!\n\nWe discovered key Best Practices and techniques for bridging the gap between Agile development programs and other types of program that include hardware or a mix of hardware and software. \n\nThis tutorial will 1) present select findings from the study; 2) discuss the aspects of agile that are easily applicable to hardware and other types of development programs; 3) present Best Practices for bridging Agile software programs with traditional hardware development in mixed product development projects.",
                        "descriptionShort": "You will learn about the results of our 2013 research with Silicon Valley companies which shows that the most impactful elements Agile/Scrum are not unique to software, and I will share best practices that can be applied to mixed-platforms.",
                        "confRegistrationLine": "",
                        "createDate": "2014-08-15T16:25:13.237Z",
                        "updateDate": "2014-08-17T12:19:31Z",
                        "sessionLevelId": 2,
                        "sessionCategoryId": 2,
                        "notesToSpeaker": "",
                        "sessionTimeCustom": "",
                        "sessionTimeDateTime": "2014-10-11T17:00:00",
                        "sessionTimeDateTimeString": "2014-10-11T17:00:00",
                        "descriptionFirstParagraph": "Time has proven that Agile development has provided huge gains for software development....",
