                        "adminComments": "",
                        "title": "Design Strategies with AngularJS",
                        "sessionsMaterialUrl": "http://www.slideshare.net/smartorginc/design-strategies-for-angularjs",
                        "description": "AngularJS has changed the way we think about web-development. This session is for programmers interested in using AngularJS seriously and will focus on three patterns of usage: multi-page, single page, and legacy applications. Multi-page applications follow a straight-forward MVC paradigm. Single-page applications with lots of interactions are much more complex, and require the use of nested directives. Legacy applications are those where you can only use Angular in some portions of an existing web application. This requires thoughtful data passing to make your Angular widgets work. In addition, keeping domain logic modular is a challenge, and we will show how we use Typescript to do this. We will also show examples of code before and after Angularizing them, in particular, comparing it to Backbone. If you have never seen AngularJS in action, we recommend taking one of the beginner AngularJS sessions at CodeCamp before you come to this session. If you are starting out with Angular, this session will leave you with a useful map of patterns of wisdom that will help you ask the right questions as you are designing your solution.\n\nPlease download the slides in the Materials link and bring it with you to the session so you can follow along (there's code in it).",
