                        "title": "Designing a Beautiful REST+JSON API",
                        "sessionsMaterialUrl": "",
                        "description": "Designing a really clean and intuitive REST + JSON API is no small feat.  You have to worry about resources, collections of resources, pagination, query parameters, references to other resources, which HTTP Methods to use, HTTP Caching, security, and more!  And you have to make sure it lasts and doesn't break clients as you add features over time. Further, while there are many references on creating REST APIs with XML, there are much fewer references for REST + JSON.\n\nIn this presentation, Les Hazlewood - Stormpath CTO and Apache Shiro PMC Chair - will share all of the golden nuggets learned while designing, implementing and supporting JSON-based REST APIs, using examples from a clean real-world REST+JSON API.  He will cover:\n\n* JSON-based data formats in a RESTful API\n* References to other JSON-based resources (aka 'linking').\n* Resource collections and pagination\n* How to map (and how not to map) HTTP methods to Resource CRUD\n* Resource partial updates\n* Supporting HTTP Method Overloading for clients that don't support HTTP PUT and DELETE\n* API versioning strategies\n* Meaningful Error responses\n* Many-to-many resource relationships\n* HTTP Caching and Optimistic concurrency control.\n* Authentication and Security\n",
                        "descriptionShort": "In this presentation, Les Hazlewood - Stormpath CTO and Apache Shiro PMC Chair - will share all of the golden nuggets learned while designing, implementing and supporting JSON-based REST APIs, using examples from a clean real-world REST+JSON API.",
