                        "title": "Designing Irresistible APIs",
                        "sessionsMaterialUrl": "http://www.princesspolymath.com/princess_polymath/?page_id=727",
                        "description": "When creating a new REST platform, the planning process frequently gets skipped (or is misunderstood) resulting in an ill-conceived API. I’ll walk you through the steps needed to create an API that developers love, and point out the common traps to avoid.\n\nThe presentation will cover creating user stories, deciding on metrics, planning the API, design decisions, documentation and developer support. I will focus on teaching you how to create a developer experience that will delight and amaze your developer partners and increase engagement with your platform. This talk will focus on higher level choices rather than HTTP architecture, and is appropriate for developers, product managers, or anyone else with an interest in achieving success for their API program.\n\nThe Open API Ecosystem is an amazing opportunity for companies to partner with developers, but you really only get one chance to impress, so come learn how to make your company’s API an “A List” destination.",
                        "descriptionShort": "Learn how to make your API a First Class Product - the process taught here will help developers, product managers and executives understand how to create an API with vision, value and an engaging developer experience.",
