                        "title": "Develop the right product faster: design thinking for engineers",
                        "sessionsMaterialUrl": "http://goo.gl/aBjuDf?",
                        "description": "<p>As software engineers, we are very abstract thinkers.&#160;&#160; We've learned how to collect a broad set of use-cases and design elegant code to solve those problems.&#160;&#160; This session will teach engineers how to apply the same abstract thinking towards solving customer problems through design, resulting in not only elegant code, but elegant products as well. </p>\n\n<p>Topics include:</p>\n\n<ul>\n  <li>How to identify important customer problems worth solving </li>\n  <li>Understanding insight vs observation </li>\n  <li>Abstract concept design </li>\n  <li>Working effectively with experience designers </li>\n</ul>",
