                        "sessionTimeDateTimeString": "2014-10-11T17:00:00",
                        "descriptionFirstParagraph": "The micro-service architecture, which structures an application as a set of small,...",
                        "descriptionAfterFirstParagraph": " narrowly focused, independently deployable services, is becoming an increasingly popular way to build applications. This approach avoids many of the problems of a monolithic architecture. It simplifies deployment and let’s you create highly scalable and available applications.\n\nIn this talk we describe the micro-service architecture and how to use it to build complex applications. You will learn how techniques such as Command Query Responsibility Segregation (CQRS) and Event Sourcing address the key challenges of developing applications with this architecture. We will also cover some of the various frameworks such as NodeJS and Spring Boot that you can use to implement micro-services.\n",
                        "hasProctors": false,
                        "sessionUrl": "/Session/2014/developing-applications-with-a-micro-service-architecture",
