                        "sessionsMaterialUrl": "http://channel9.msdn.com/Events/Build/2014/3-573",
                        "description": "Office 365 is an ideal business app platform providing a core set of services expected in today’s business apps like collaboration, presence and integrated workflows, and a central location for installing, discovering and managing the apps. Office 365 makes these business apps available where users already spend their time – in SharePoint & Office. Visual Studio 2013 streamlines the way developers build modern business applications for Office 365 and SharePoint 2013 with the Office 365 Cloud Business App project. In this demo-heavy session, you will see the latest enhancements we’ve made that allow developers to build connected, touch-centric, cross-platform, HTML5-based business applications for Office 365.",
