                        "title": "Developing Real Time Recommendation Engine",
                        "sessionsMaterialUrl": "",
                        "description": "In this session, you will learn about real time recommendation engines in general. First, we will discuss few use cases to start the session. We will review types of recommendation engines.  Will  introduce KIJI Framework used to develop recommendation engines. Will cover KIJI schema and software stack in detail and GitHub code repository. Will demonstrate how to use KIJI to develop your own recommendation engines. For beginners, we will quickly review Hadoop Framework as well. In the end, you will learn how we can use open source software to develop real time recommendation engines.",
