                        "description": "Cloud based, highly scalable systems provide significant value to business and the software community. However, these systems are not a panacea and there is a paradigm shift when building highly scalable systems, cloud based systems. Though the technical inflection may appear to be slight, building and deploying these systems affects everything - from system architectures, design principles, programming models all the way through to software deployment and maintenance.\n\nThis talk goes into some of the common design patterns and practices that can be used to develop and deploy distributed system. Examples of design and access patterns include: Zookeeper, Solr, Cassandra, HBase and the architecture of StubHubs Big Data platform.",
                        "descriptionShort": "Patterns and practices for developing and deploying distributed systems.",
