                        "title": "Dive into Cloud Foundry PaaS",
                        "sessionsMaterialUrl": "",
                        "description": "IT departments and hosting providers are increasingly adopting Platform as a Service in response to developer demand. Cloud Foundry PaaS dramatically reduces development cycles and accelerates time to market for developers and cloud operators alike. Enterprises seeking to leverage PaaS can now consider numerous options for both public and private deployments.\nIf you want to provide your colleagues or customers an easy way to developing, testing, and deploying their apps, this is a session to attend! That is, learn why and how you can get your own Platform as a Service on AWS or OpenStack. This session will shed the light on a path to offering high-impact application development platform as a service.",
