                        "title": "Engineering without Borders",
                        "sessionsMaterialUrl": "",
                        "description": "Today, most companies development teams are distributed around the world. \"Engineering without Borders\" has become the norm, distributed teams have a lot of advantages scalability, cost efficiency and diversity. However, global teams also face many challenges including cultural, work and time differences. In this presentation we will discuss effective strategies on building synergies in distributed teams to successfully launch products around the world.",
                        "descriptionShort": "Research demonstrates that openly recognizing cultural differences and intentionally strengthening social ties among team members are criteria for building trust in distributed teams. ",
