                        "title": "Exploring the Brain-Computer Interface",
                        "sessionsMaterialUrl": "https://www.slideshare.net/jimmckeeth/jim-mc-keeth-wearable-thought-input/",
                        "description": "A new generation of wearable devices are coming out that detect our thoughts, feelings and facial expressions via the electrical currents our body produces. These new devices interface directly with mobile devices via a Bluetooth connection and are designed to provide input all day long.\n \nWhat potential does the Brain-Computer Interface provide for wearable purposes? What is the difference between passive monitoring and active detection? What sort of input is possible? Is the Brain-Computer Interface one way, or is direct brain input possible too?\n \nIn this class, we will dive into the future of thought as input for wearable development with real-world examples and code. Demonstrations will be shown using the Emotiv EPOC headset, a high resolution, neuro-signal acquisition and processing wireless neuroheadset that uses a set of sensors to tune into electric signals produced by the brain to detect thoughts, feelings and expressions. Additional devices will be discussed and may be used as they become available.\n \nYou will see the EEG neuroheadset and brain-computer interface with examples of interfacing with desktop and mobile apps. We will dive into the roots of the technology, showing code and examples along with big pictures of the technology. You will walk away with an understanding of how this still evolving and largely unknown technology really works, how it can be used, as well as longer-term implications.",
                        "descriptionShort": "The Brain-Computer Interface is a mainstay of science-fiction. Come learn the science fact with an actual demonstrations of a Brain-Computer Interface in action as a volunteer flies a Quadricopter using only their mind.",
                        "confRegistrationLine": "",
