                        "title": "F# for the C# developer",
                        "sessionsMaterialUrl": "",
                        "description": "Back in 2010, Visual Studio came with a new language on board: F#. Out of curiosity, I started playing with it, and got hooked. F# is a fantastic language - it mixes functional and Object Oriented approaches seamlessly, encourages writing bug-free code (it is virtually impossible to get a null exception...), comes with great features, and is incredibly productive. \nIn this talk, I will give a intro to F# for C# developers, illustrated with live code samples, and discuss where it fits and how you can get started with it!",
                        "descriptionShort": "F# is a .NET language that mixes functional and Object Oriented approaches seamlessly, encourages writing bug-free code, and is incredibly productive. I will illustrate with live code where it fits and how you can get started with it.",
