                        "title": "F# on the Web",
                        "sessionsMaterialUrl": "https://panesofglass.github.io/TodoBackendFSharp",
                        "description": "Most people think of F# as good at math or complex problem solving. It is actually a fantastic for a very wide array of tasks, including web programming, which helped the start-up Tachyus go from 0 to production in 12 weeks. In this talk, we'll compare and contrast a web application written in familiar C# patterns with various features provided by F#, including function composition, computation expressions (async), type providers, and active patterns. We'll also cover differences in application design patterns. ",
