                        "title": "First steps with MongoDB",
                        "sessionsMaterialUrl": "",
                        "description": "MongoDB is a very popular NoSQL database that is fast and scalable. This talk will get you familiar with this unique database and arm you with the essential skills to start using Mongo to power your software applications. We’ll talk about document oriented databases. You will see some of the core strengths (and challenges!) of using MongoDB to power your application. And, of course, some code to demo how all of this ties together!\nThis session is thin on power point. We'll try cover as much ground as time permits and get your familiar with the basic concepts that differentiate this technology from its competitors.\nLeave your SQL thinking behind and come see how things can be very different with MongoDB.\n",
                        "descriptionShort": "MongoDB is a very popular NoSQL database that is fast and scalable. This talk will arm you with the essential skills to start using Mongo. Leave your tabular thinking behind and come see how things can be very different with MongoDB.",
