                        "title": "Foothill College Does Everything, Learn More",
                        "sessionsMaterialUrl": "",
                        "description": "<p>How do community colleges like Foothill College fit into the California education and workforce landscape?&#160; How does Foothill transfer 19 students to MIT in the past 6 years AND consistently have Dental Hygiene students with a 100% pass rate for the National Board?&#160; Come to this session and join this presentation and open discussion lead by John Mummert, VP of Workforce Development and Institutional Advancement at Foothill.&#160; Topics will include:<u></u><u></u></p>\n\n<ul>\n  <li>What Opportunities Are Available to become a Foothill College Student<u></u><u></u></li>\n\n  <li>What Opportunities Are Available to Teach at Foothill College<u></u><u></u></li>\n\n  <li>What Opportunities Are Available for Your Company to Work with Foothill Including Internships<u></u><u></u></li>\n\n  <li>How Does Foothill College Fit into the California Education System<u></u><u></u></li>\n\n  <li>Learn Why Foothill Sends so Many Students for Advanced Degrees to Colleges like Stanford, MIT and Others</li>\n</ul>",
                        "descriptionShort": "<p>How do community colleges like Foothill College fit into the California education and workforce landscape?&#160; How does Foothill transfer 19 students to MIT in the past 6 years AND consistently have Dental Hygiene students with a 100% pass rate for the National Board?&#160; Come to this session and join this presentation and open discussion lead by John Mummert, VP of Workforce Development and Institutional Advancement at Foothill.&#160; Topics will include:<u></u><u></u></p>",
                        "confRegistrationLine": "",
