                        "title": "Fun with Lambdas: C++14 Style",
                        "sessionsMaterialUrl": "http://www.slideshare.net/SumantTambe/fun-with-lambdas-c14-style",
                        "description": "If virtual functions in C++ imply design patterns, then C++ lambdas imply what? What does it really mean to have lambdas in C++? Guess what, it's BIG. Just like virtual functions open doors to the OO paradigm, lambdas open doors to a different paradigm--the Functional paradigm. This talk is not a praise of functional programming or some elusive lambda-based library. (Although, I'll mention one briefly that tops my list these days) Instead, the goal is to have fun while working our way through some mind-bending examples of C++14 lambdas. Beware, your brain will hurt! Bring your laptop and code the examples right along because that may be the fastest way to answer the quiz.",
                        "descriptionShort": "Learn from some mind-bending examples of generic lambdas in C++14 and how they open doors to the Functional programming style in C++14.",
