                        "sessionsMaterialUrl": "",
                        "description": "The re-emergence of functional programming coincides nicely with the JavaScript renaissance. But where does the UI fit in?\n\nIn this talk we'll cover the core concepts of Functional Reactive Programming while learning a practical application of them using Bacon.js. You'll learn how to build user interface components in a clear, declarative style by modeling both user interaction and back-end processing using one clean abstraction: streams of events.",
