                        "title": "GameMaker Studio: Easy Game Development for All Ages",
                        "sessionsMaterialUrl": "http://bit.ly/codecamp14-gamemaker",
                        "description": "GameMaker Studio from YoYo Games is a game development tool easy enough for beginners to create games without coding, then proceed to learn programming with its scripting capabilities.   GameMaker Studio is also advanced enough for seasoned game developers to build games for desktops, web (HTML5),  and Android & iOS mobile devices.\n\nIn this hands-on tutorial, you will be introduced to GameMaker Studio drag and drop functionality to build an arcade game, with brief exposure to scripting.  In the process, you will learn how to create a \"game plan\", identifying the game assets and objects, and designing behaviors and interactions.  I will also mention the advantages of GameMaker over other game development environments such as Stencyl,  GameSalad, Construct 2, and Unity.\n\nIf you'd like to do the exercise, please  bring a Windows laptop or a Mac with Windows on a Virtual Machine or Bootcamp. Also, if possible, download and install the free GameMaker Studio Standard ahead of time (http://www.yoyogames.com/studio/download)",
