                        "title": "Getting started with developing Big Data Solutions using HBase.",
                        "sessionsMaterialUrl": "",
                        "description": "Having problem scaling your SQL Database?\nHBase allows you to build big data applications for scaling, but with this comes some different ways of implementing applications compared to developing with traditional relational databases. For example, in HBase you cannot do transactions spanning multiple tables.  In this session, you will learn how, in some cases, to work around to implement transactions using HBase. We will explore real-world big data problems and talk about architectures, APIs, and key parts of HBase for developing efficient big data applications to solve these problems. In this session, you will learn how setup MapR Sandbox and get started with HBase application development. We will go through some best practices and how to apply them using demos and code.\nI can present this as a 50 minutes session or 120 minutes Hands-on Lab/Session.",
                        "descriptionShort": "Having problem scaling your SQL Database?\nIn this session, you will learn how setup MapR Sandbox and get started with HBase application development,  in some cases, to work around to implement transactions using HBase.",
