                        "title": "Getting started with Hadoop on the Cloud",
                        "sessionsMaterialUrl": "http://goo.gl/wqWm1H",
                        "description": "Hadoop and Cloud is an almost perfect marriage.   Hadoop is a distributed computing framework that leverages a cluster built on commodity hardware.   The Cloud simplifies provisioning of machines and software.   Getting started with Hadoop on the Cloud makes it simple to provision your environment quickly and actually get started using Hadoop.    IBM Bluemix has democratized Hadoop for the masses!   This session will provide a brief introduction to what Hadoop is, how does cloud work and will then focus on how to get started via a series of demos.   We will conclude with a discussion around the tutorials and public datasets - all of the tools needed to get you started quickly.",
