                        "description": "Greenfoot provides a framework for easily programming interactive 2-D simulations and games based on a World and Actor model. Programming concepts and techniques are introduced and practiced through a series of fun programming examples such as creating simple interactive games and simulations.\n\nStudents will use the Java programming language to define objects, variables and methods for implementing their simulations and games. During the workshop, attendees will be introduced to Greenfoot and Java programming, view and run sample programs, and write Java code to add functionality and create new programs.\n\nStudents should  bring a laptop computers to class, with the Greenfoot software and Java development kit (JDK) installed as described at www.Greenfoot.org.  The sample programs and examples from the instructor's web site (www.RoboticsLearning.com/java) should also be downloaded prior to the workshop.\n\nNote Greenfoot session 1 and session 2 will include different programming examples and challenges.",
