                        "title": "Growing technologists through autonomy, mastery and purpose",
                        "sessionsMaterialUrl": "",
                        "description": "The focus of this talk is technologists and how to keep them engaged. An engaged employee is loyal, energetic, and enthusiastic about his/her job and the company. As a technology training and engagement group at PayPal we have devised programs that support technologists to grow by following the principles of autonomy, mastery and purpose. Autonomy makes technologists self sufficient, mastery arms them with skills to be the best in their trade and purpose provides them with a reason to grow, learn and excel. This growth is measured by Employee Net Promoter Score (eNPS). eNPS helps understand which elements of employee engagement advocate employee loyalty and which areas require improvement. This effort in turn leads to better products and happier customers.\n",
                        "descriptionShort": "Enable technical people to thrive through autonomy, mastery, purpose as measured by eNPS",
