                        "title": "Hiring A Big Data and Data Science Team ",
                        "sessionsMaterialUrl": "",
                        "description": "Hiring a new member to your team is always a daunting task. Now combine that with looking to fill “The Sexiest Job of the Century”, Data Scientist, or the equally hard to find, \"Data Wrangler\", and you can have quite the conundrum. \n\nThe talk will be centred on all general hiring practices, as well as specifics on how to hire Data Scientists and Data Wrangles.   Specifically there will be sections on:\n\n  - What position are you trying to hire.\n  - Finding someone to fit the position.\n  - How to interview the candidate.\n",
