                        "approved": true,
                        "adminComments": "",
                        "title": "How Do Teams Reach High Performance?",
                        "sessionsMaterialUrl": "http://www.actuationconsulting.com/the-study-of-product-team-performance/",
                        "description": "How do you improve your product team's performance?\n <br /> <br />\nAs we propose this session, data from the 2014 Study of Product Team Performance is being analyzed, the third year that Actuation Consulting in association with leading industry associations in the product management, project management and engineering communities has conducted this study of the global factors that drive high performance product teams.\n <br /> <br />\n<a href=\"http://actuationconsultingllc.com/whitepaper_request.php\"target=_blank>The 2012 Study</a> revealed five practices that, if product teams do them, gives them a 67% likelihood of achieving high team performance. (Similarly, if they practice none of them, they'll have a miniscule 2% likelihood of achieving high team performance!).\n <br /> <br />\n<a href=\"http://actuationconsultingllc.com/whitepaper_request_2013.php\"target=_blank>The 2013 Study</a> revealed rapid growth in the number of teams becoming agile - and fascinating insight into development methods and practices teams believe improve their products' profitability.\n <br /> <br />\nStudy lead author Greg Geracie and co-author Ron Lichty will present key findings emerging from the 2014 global study of product team performance - as well as the 2012 study's five factors - and the 2013 study's guidance from teams on practices to improve profitability. \n <br /> <br />\nJoin us and learn how you can improve your product team's performance!",
                        "descriptionShort": "This year Greg Geracie and Ron Lichty will present key findings from the 2014 global study of product team performance. Join us! Learn how you can improve your product team's performance! ",
