                        "adminComments": "",
                        "title": "How to Build Your Own Internet of Things Product with Raspberry PI",
                        "sessionsMaterialUrl": "http://msdn.microsoft.com/en-us/magazine/dn781356.aspx",
                        "description": "In this session you will start with a pile of hardware and build a working, cloud-enabled device from the ground up. \n\nEssential skills will be presented:\n(1)Building the device from raw hardware \n(2)Writing software for the Raspberry PI and the Cloud \n(3)Mono and C# on the device\n(4)Node.js in the cloud\n\nWe will also present “SmartDoor,” where we really roll up our sleeves, both from a hardware and software point of view and learn what it takes to truly embrace this new computing paradigm. To start, we will purchase and put together the raw hardware. But software rules the world, and that’s where a bulk of the presentation will focus. The code will need to be able to take a picture and upload it to the cloud. From there, a push notification will need to be sent to the appropriate mobile device(s), indicating that someone has pressed the doorbell, and that the photo is available.\n\nWhat other capabilities with respect to CPU, memory, and storage?\nWhat expansion boards are available and what purpose do they serve?\nWhat type of programming tools are available?\nWhat programming languages are supported in the device itself?\nWhat role does the cloud play with respect to security?\nWhich networking connectivity solutions that should be considered for device-to-cloud communication?\nHow does the cloud help alleviate bandwidth challenges and minimize power consumption on the device?\nWhat are the four patterns for device to cloud service message communication?\n",
                        "descriptionShort": "In this session you will start with a pile of hardware and build a working, cloud-enabled device from the ground up. You will build some key skills, such as building the device from hardware, writing device and cloud software.",
                        "confRegistrationLine": "",
                        "createDate": "2014-08-07T08:56:30.717Z",
                        "updateDate": "2014-08-06T19:07:55Z",
                        "sessionLevelId": 1,
                        "sessionCategoryId": 23,
                        "notesToSpeaker": "",
                        "sessionTimeCustom": "",
                        "sessionTimeDateTime": "2014-10-11T17:00:00",
                        "sessionTimeDateTimeString": "2014-10-11T17:00:00",
                        "descriptionFirstParagraph": "In this session you will start with a pile of hardware and build a working, cloud-enabled...",
                        "descriptionAfterFirstParagraph": " device from the ground up. \n\nEssential skills will be presented:\n(1)Building the device from raw hardware \n(2)Writing software for the Raspberry PI and the Cloud \n(3)Mono and C# on the device\n(4)Node.js in the cloud\n\nWe will also present “SmartDoor,” where we really roll up our sleeves, both from a hardware and software point of view and learn what it takes to truly embrace this new computing paradigm. To start, we will purchase and put together the raw hardware. But software rules the world, and that’s where a bulk of the presentation will focus. The code will need to be able to take a picture and upload it to the cloud. From there, a push notification will need to be sent to the appropriate mobile device(s), indicating that someone has pressed the doorbell, and that the photo is available.\n\nWhat other capabilities with respect to CPU, memory, and storage?\nWhat expansion boards are available and what purpose do they serve?\nWhat type of programming tools are available?\nWhat programming languages are supported in the device itself?\nWhat role does the cloud play with respect to security?\nWhich networking connectivity solutions that should be considered for device-to-cloud communication?\nHow does the cloud help alleviate bandwidth challenges and minimize power consumption on the device?\nWhat are the four patterns for device to cloud service message communication?\n",
