                        "title": "Improving your Frontend with Ember (MVC JS Framework)",
                        "sessionsMaterialUrl": "http://emberjs.com/",
                        "description": "Front end development has really progressed in the last two years. You've probably seen the shifting landscape of JavaScript frameworks, Backbone, Angular, Ember, etc. I'll be giving you an in-depth look at Ember. I'll briefly cover the advantages and disadvantages of Ember (comparative look, not a flame war) and then we'll dive into some awesome code (hello world, explain file structure, explaining resources to help you after my presentation, etc).\n\nFront ends can do marvelous things now a days, from caching, fully featured Data Access Layers, and data binding (single source of truth on the model, and templates/views that automagically stay up to date). Let's have some fun, I hope you join me on this guided adventure through EmberJS!",
