                        "title": "Intro to Mobile Game Programming with Cocos2d-x, Part 1",
                        "sessionsMaterialUrl": "https://github.com/Rockncoder/PlaneGame2",
                        "description": "If we've learned anything from the \"Flappy Bird\" incident, it is that it is still possible for a free game, from an independent developer to make money, a lot of money. Video games are extremely popular on smart phones and tablets. While the odds are against your game becoming a smash hit, is still possible to make a fun game which generates a bit of money via direct sales or in-game advertising. \n\nIn this three part session we will explore using Cocos2d-x, an open source game engine, to build games for all three major smart phone platforms - Android, Apple, and Microsoft. Unlike other game engines, Cocos2d-x is not only free, it runs on multiple platforms giving you the ability to port your game not only to the most popular phone platforms but to desktop platforms like Windows and Mac OS X.\n",
                        "descriptionShort": "Learn to build mobile games with the free and open source Cocos2d-x game engine.",
