                        "title": "Introduction to Machine Learning with Azure ML",
                        "sessionsMaterialUrl": "http://bit.ly/1p9bNq4",
                        "description": "Machine Learning allows us to build intelligent software systems of tomorrow - these systems allow us to better diagnose and treat patients, correctly recommend interesting books or movies, and even make the self-driving car a reality. Combining Machine Learning with cloud technologies, such as Azure, reduces the friction and lowers the knowledge barriers for people doing their own experimentation on data. Azure ML, a new offering from Microsoft, allows us to harness the power or Machine Learning and Big Data with little more than a browser and a credit card. In this session, we will take a look at how to create ML models with Azure ML Studio and deploy those models to production in minutes. We will also touch on integrating Azure ML with HDInsight (Hadoop as a Service on Azure). Participants will walk away with basic knowledge necessary to start applying a bit of ML magic to their own data sets, no matter how big or small.",
                        "descriptionShort": "Azure ML is a cloud service for predictive analytics, allowing simple drag-and-drop gestures for people without deep data science background. In this session, we will explore Azure ML and other approaches to machine learning in the cloud on Azure.",
