                        "title": "Introduction to Natural Language Processing (NLP)",
                        "sessionsMaterialUrl": "http://www.alokgovil.com/Presentations/Introduction-to-NLP.pdf",
                        "description": "Natural Language Processing (NLP) and Understanding (NLU) aim to make machines process human languages like English.  This session will provide a complete overview of the field from the basic structure of human languages to the state of the art.\n\nThe session will focus on (a) deep theoretical understanding instead of mere use of pre-existing NLP libraries, (b) natural language understanding aspects instead of keywords-based analysis or text classification, (c) processing of 'English' 'text' and not speech recognition/synthesis or language translation.\n\nWe will discuss NLP applications and challenges, language components, Chomsky’s hierarchy of grammars, parsing algorithms, word-sense disambiguation, logic and inference, language synthesis, and available test/training datasets.",
                        "descriptionShort": "Natural Language Processing (NLP) and Understanding (NLU) aim to make machines process human languages like English.  This session will provide a complete overview of the field from the basic structure of human languages to the state of the art.",
