                        "title": "Introduction to NoSQL",
                        "sessionsMaterialUrl": "",
                        "description": "Before they were called cars, they were \"horseless carriages\".  That's what NoSQL is: something better than the past but still defined in terms of the past.\n\nFor decades we had one way of storing data, the relational model.  Now databases come with new data models, new index schemes, and new scaling architectures.  They're also much more cloud-focused than previous systems.\n\nIt's an exciting time again to be a database administrator, or a programmer, and this talk gets you oriented.  We'll cover how we got here, where we're at, and where we're going.  We'll discuss data models (key-value, document, graph), licensing (open source, commercial), and transaction models (ACID vs BASE).  We'll also show running code.\n",
                        "descriptionShort": "This talk is designed to get you oriented in the new world of NoSQL databases.  I'll cover how we got here, where we're at, and where we're going.  ",
                        "confRegistrationLine": "",
                        "createDate": "2014-05-09T09:07:47.3Z",
                        "updateDate": "2014-05-09T02:07:55Z",
