                        "title": "Introduction to Smartwatch Programming",
                        "sessionsMaterialUrl": "",
                        "description": "<p>Smartwatches are the first devices to enter the wearables revolution. Programming for smartwatches though require adopting new programming paradigms more radical than with the mobile transition.</p>\n\n<p>In this session we are going to discuss how to approach smartwatch programming then we will compare several smartwatch development platforms including Pebble, Android Wear, Samsung Tizen, Sony Smartwatch and Apple Watch.</p>\n\n<p>Each smartwatch vendor took a different approach for interacting with the connected mobile phone and for developing applications. </p>\n\n<p>Then we will go into more detail over Pebble SDK and build programs with CloudPebble in Javascript and deploy them to a smartwatch.</p>",
                        "descriptionShort": "In this session we are going to discuss how to approach smartwatch programming then we will compare several smartwatch development platforms including Pebble, Android Wear, Samsung Tizen, Sony Smartwatch and Apple Watch.",
