                        "title": "Introductory Minecraft Modding with Forge - Part II",
                        "sessionsMaterialUrl": "",
                        "description": "In this session, you will learn the basics of making Minecraft mods using Forge. Server mods let you change the way the Minecraft server works. You can make bigger TNT explosions, change the sound of entities, make zombies drop diamonds, create new crafting and smelting recipe and much more. This session will cover the basics of setting setting up Forge environment and an introduction to creating mods. We will create a few plugins. Make sure to bring your laptop. The list of software will be provided a few days before the event.",
