                        "title": "IoT Magic Show",
                        "description": "What do magicians and programmers have in common?  They are good at juggling, have very nimble fingertips, often make things vanish, and have lovely assistants!  Ok, so maybe not all of those describe your average hacker (unless your pair programmer partner happens to be Penny), but we are going to try to put on the most spectacular magic show that has ever been seen on the stage at a tech conference! [geeks only]\n\nAs proper geeks, we are going to make heavy use of embedded wearable and internet connected devices to make up for our lack of dexterity and supernatural powers.  Also, all tricks will be revealed with the designs available to reproduce in the spirit of open source and creative commons.  Come join us to see for yourself what real [hacker] magic looks like!",
