                        "title": "Java EE 7 development using Eclipse",
                        "sessionsMaterialUrl": "",
                        "description": "The Java EE 7 platform focuses on Productivity and HTML5. JAX-RS 2 adds a new Client API to invoke the RESTful endpoints, allows asynchronous client/server, and server-side content negotiation. JMS 2 is undergoing a complete overhaul to align with improvements in the Java language. Long awaited Batch Processing API and Concurrency are now added to build applications using capabilities of the platform itself. Together these APIs allow you to be more productive by simplifying enterprise development.\nWebSocket attempts to solve the issues and limitations of HTTP for real-time communication. A new API is added to build WebSocket driven applications. Processing JSON structures is inherent in any HTML5 applications and a new API to parse and generate JSON is being added to the platform. JavaServer Faces will add support for creating reusable flows and HTML5-friendly markup. There are several other improvements in this latest version of the platform.\nThe Java EE 7 platform was released last year. This talk will explain how to do Java EE 7 development using Eclipse. Don't miss out on this session to learn all about how to leverage the new and exciting standards in building your next enterprise application.",
