                        "title": "Java on Rails - Using Spring Boot For Rapid Application Development",
                        "sessionsMaterialUrl": "",
                        "description": "Spring Boot provides a rapid development framework leveraging a host of Spring and third party components.  It favors convention over configuration and gets many of the basics up and running with virtually no code OR configuration required.  However, to get beyond hello world takes some doing, even if it is easier than ever.  This code walkthrough will go over basics such as Security (Log in), User provisioning (Sign Up), JSON APIs, error handling, application events, HTML5 SPA bootstrapping, instrumentation, service and repository layers, Apache HTTP and Tomcat configuration as well as Cloud deployment processing and packaging.",
