                        "title": "JavaScript and Internet Controlled Hardware Prototyping",
                        "sessionsMaterialUrl": "",
                        "description": "The electronics maker movement has led a massive shift in how people are re-engineering the world around them through rapid hardware prototyping. With the rise of inexpensive, wifi and bluetooth low energy enabled electronics, this hardware revolution is internet and mobile controlled, all through simple bridges to build the electronics intelligence in familiar web languages.\n\nIn this session, we will play with Arduino microcontrollers and JavaScript to take a first dive into the world of internet controlled electronics, exploring topics such as:\n- Setting up an Arduino to be controlled through web APIs\n- Using JavaScript language bridges on the Arduino\n- The future of web controlled hardware prototyping",
                        "descriptionShort": "In this session we'll be exploring how to build rapid hardware prototypes using Arduino boards, all controlled through JavaScript and API data, to allow for innovative, web enabled, software to hardware development techniques.",
