                        "title": "Learn JavaScript by modeling and solving Rubik's Cuibe",
                        "sessionsMaterialUrl": "https://github.com/krmanoj/CodeCamp/tree/master/2014",
                        "description": "We will start with the basics of Java Script and touch upon many of the new features in this language. We will then examine the two models of the Rubik's cube: first using object oriented programming and then using functional programming just to get a feel of these two techniques. We will also discuss some algorithms to find useful moves by simple search mechanism enhanced with Rubik's cube common sense. Join us if you are new to JavaScript, have interest in Rubik's cube or just want to have some fun with programming.\nFor those who attended this session last year, you will like the new features in Java Script and an introduction to Functional Programming.  I promise we will have some fun time with the Rubik’s cube too.\n\nPresentation is available at https://github.com/krmanoj/CodeCamp/tree/master/2014/ppt .\n\n   To download the eclipse project for Rubik's cube simulation, clone https://github.com/krmanoj/CodeCamp.git, and use 2014 version.\n\nOpen rubik.html in the browser to see the simulation.(2014/app/rc5/WebContent/rubik.html)\n\nContact me at kr_manoj@yahoo.com \n",
