                        "title": "Learn to Love Lambdas (C#)",
                        "sessionsMaterialUrl": "http://www.jeremybytes.com/Demos.aspx#LLL",
                        "description": "Lambda expressions can be confusing the first time you walk up to them. But once you get to know them, you’ll see that they are a great addition to your toolbox. Used properly, they can add elegance and simplicity to your code. And some .NET constructs (such as LINQ) lend themselves to lambda expressions. We’ll take a look at how lambda expressions work and see them in action.  No specific experience is required (but some .NET is helpful).",
