                        "sessionsMaterialUrl": "",
                        "description": "Lego Mindstorms EV3 is a great way to introduce kids into the world of programming by controlling the physical world with their computers.  In this session we will be using the Java programming language to write simple algorithms that power windmills, drive cars, and draw pictures.  Students will get a chance to build projects from scratch with Lego bricks, deploy and run Java on the Mindstorms Intelligent Brick, and edit Java code on their laptops to make improvements to the projects.  Lego Mindstorms hardware will be supplied for use during the lab; however, students will receive a printed project guide and are encouraged to continue exploring and learning at home.",
