                        "title": "Manipulating Properties in Scala. Why Flat Properties are Best.",
                        "sessionsMaterialUrl": "",
                        "description": "There is a reason why XML and JSON are not parseable by regexes. There is a reason why storing XML or JSON in a db is a wrong idea - they are not parseable by regexes. But we can convert them into structures that are.\n\nFlattened properties can be versatile, while being very simple. A class Props that I've been developing is an example of such versatility.\n\nAnother class, Result, is worth discussing together with this class.",
                        "descriptionShort": "During the last 2 years I've been developing a container for properties in Scala. Other solutions exist, but this one is pretty sophisticated. \nI'll also demonstrate why properties should be flat in memory.",
                        "confRegistrationLine": "",
                        "createDate": "2014-07-31T17:11:11.517Z",
                        "updateDate": "2014-08-02T06:53:54Z",
                        "sessionLevelId": 3,
                        "sessionCategoryId": 21,
                        "notesToSpeaker": "",
                        "sessionTimeCustom": "",
                        "sessionTimeDateTime": "2014-10-11T13:45:00",
                        "sessionTimeDateTimeString": "2014-10-11T13:45:00",
                        "descriptionFirstParagraph": "There is a reason why XML and JSON are not parseable by regexes. There is a reason why...",
                        "descriptionAfterFirstParagraph": " storing XML or JSON in a db is a wrong idea - they are not parseable by regexes. But we can convert them into structures that are.\n\nFlattened properties can be versatile, while being very simple. A class Props that I've been developing is an example of such versatility.\n\nAnother class, Result, is worth discussing together with this class.",
