                        "title": "Maximize your Cache for no Cash",
                        "sessionsMaterialUrl": "http://slidesha.re/1vQDbOv",
                        "description": "There are six levels of cache between your code and the users browser experience. You can take advantage of them all to provide a quicker, slicker, better user experience for the user and it won't cost you a dime to do it. You can use an OpCode Cache on the Server, a Content Development Network (for free), make use of the browser cache, setup an App Cache, use Session and Local Storage. They are all there, they are all free and this talk will go over all of them, the pros and the few downsides.",
