                        "title": "Monetize Your iOS and Android Apps with Multiple Ad Networks",
                        "sessionsMaterialUrl": "http://dev.twitter.com",
                        "description": "Want to learn how to monetize your iOS or Android app?  By integrating the MoPub SDK with your application, you can experiment with multiple ad networks without integrating native SDKs from each ad network and thus maximize your revenue.  In this session, I will do a quick walkthrough of the MoPub UI and highlight what developers need to know.  I will then dive into code and demo how easy it is to work with the MoPub SDK and get different kinds of ads (banner, interstitial, video, native) up and running on a sample app.",
