                        "title": "Open Source and Web Development Using OpenUI5",
                        "sessionsMaterialUrl": "http://openui5.org",
                        "description": "In this speaking session, I'll explain and examine Open Source practices and give practical examples from a web development point of view. I'll answer fundamental questions like \"What is Open Source?\" and \"How can we benefit from Open Source?\" as well as showcase how to develop web apps using SAP's open sourced web UI toolkit called \"OpenUI5\".\nJoin me to get an introduction on not only Open Source, but also on how to develop web apps that adopt to the device & browser you are using while embracing web development best practices. I'll also explain the interplay of the most used and combined web development languages HTML, CSS & JavaScript.\n\nGeneral knowledge about coding, especially web development is beneficial.",
