                        "title": "Put pencil to paper, sketching skills for Engineers",
                        "sessionsMaterialUrl": "",
                        "description": "Many people believe that sketching is a designer-only skill and not useful for many technical jobs. However, when working in a collaborative work environment, sketching is an essential communication tool between design and engineering. This session is focused on giving practical advice and techniques for Engineers to build their sketching skills. Discussion will include sketching general concepts, user flows, user interface elements, basic wireframes, and problem statements. There will also be an opportunity to practice with several hands on activities. If you are interested in building confidence in contributing to design conversation and decisions, then this is the session for you!",
                        "descriptionShort": "Sketching is an essential communication tool between design and engineering. If you are interested in sketching and want to building confidence in contributing to design conversation and decisions, then this is the session for you!  ",
