                        "title": "Raspberry Pi Gaming 4 Kids",
                        "sessionsMaterialUrl": "",
                        "description": "The Raspberry Pi is a credit-card sized computer designed specifically for teaching programming in schools. We will be using it in this session to explore basic programming concepts in the context of a simple computer game. Students will get a chance to assemble a mini computer from scratch, learn to use the command line to compile and execute programs, and to make small enhancements to an existing program. Raspberry Pi hardware will be supplied for use during the lab; however, you are encouraged to bring your own device that you can use at home after the lab to continue exploring and learning.",
