                        "approved": true,
                        "adminComments": "",
                        "title": "Reactive, unidirectional data without a required client/server technology",
                        "sessionsMaterialUrl": "https://github.com/delphix/dxData",
                        "description": "At Delphix, we have been shipping products with a system to reactively deliver unidirectional server data objects to client applications for a couple years. While our server side is in Java, and our clients are in JavaScript (both browser and node.js) and ActionScript, the paradigms we use are in no way bound to these technology choices.\n\nWe use a language-neutral definition of all object types (including data types allowed for each property) which is used to generate object type definitions in each language environment. We then provide a \"notification system\" which pushes changes to all objects and collections of objects to any interested client. The overhead to detect changes on the server is small, and all clients are up to date with changes on the server without needing to flood the server unnecessary \"pulls\".\nCome learn about the pieces of technology we use to accomplish this, and understand how you could leverage these ideas in your own environment. Our JavaScript library, dxCoreData (built on top of BackBone.js), will be the primary client example we talk about.",
                        "descriptionShort": "At Delphix, we have been shipping a system that reactively delivers server data to clients for a couple years. While our server is in Java, and our clients are in JavaScript and ActionScript, the system is easily applied to other technologies.",
