                        "title": "Real world RESTful service development problems and solutions",
                        "sessionsMaterialUrl": "",
                        "description": "This session is a deep dive as well as an interactive discussion on design principles, considerations, lessons learned from mistakes that can be taken into account when developing RESTful services.\nIt will cover a variety of topics from Designing of RESTful resources, Versioning, Exception Handling, Caching, Validation, Security, Rate limiting, HATEOAS, Testing\nand Documentation.\nThis talk will walk through and compare the different REST API provided by companies like Twitter, Paypal, Google, Stripe and more we can learn the good, the bad and ugly. So join me in this talk to build high quality applications that can be highly scalable, available and reliable.\n",
                        "descriptionShort": "This session will cover some of the best practices, lessons learned, deep dive in designing RESTful services.  This can be targeted for the novices to advanced programmers. ",
