                        "title": "Real world reversible debugging for C/C++ developers on Linux",
                        "sessionsMaterialUrl": "",
                        "description": "Anyone who's written in C++ or other compiled languages will have had to fix bugs. Greg will give a talk on Undo’s record and replay debugging technology that allows Linux software developers to record their C/C++ program's execution, and then \"wind the tape\" back and forth in real-time. This gives a clear view of a program's execution, allowing the root causes of bugs to be found with astonishing ease. Much of the guesswork and trial-and-error is removed, meaning that bugs that might otherwise have taken weeks to fix can now be fixed in minutes. UndoDB uses advanced optimization techniques to allow practical debugging of even very large and CPU-intensive programs, with typical slow-down of only 2-4x (compared to 50,000x for gdb's process record).\n \nThrough a series of demos Greg will give an in-depth look at the Undo technology and how it works. Greg will also detail how to record a program's execution and debug problems on-site at the customer. There will be time for an interactive Q and A session at the end of the talk.\n",
                        "descriptionShort": "Through a series of demos Greg will give an in-depth look at the Undo technology and how it works. Greg will also detail how to record a program's execution and debug problems on-site at the customer. Q and A session at the end of the talk.",
