                        "title": "Running Your Spring Apps in the Cloud",
                        "sessionsMaterialUrl": "",
                        "description": "The Spring Trader application was debuted at Spring One in 2012 and presented an application that demonstrates a multitude of vFabric components working together – tcServer, RabbitMQ, SQLFire and Gemfire. In this session we will take that application and make (a few) modifications (mostly to config) to get it running on the same components in the cloud, specifically on the Cloud Foundry PaaS.  We’ll show you how to use the Spring Cloud project to configure the deployment, how to leverage a cloud services catalog, how to implement a cross-site scripting solution (and why), how to do session state caching and we’ll discuss (the dangers of) auto reconfiguration. If you bring a laptop you can have your own instance of the app running by end of session.",
                        "descriptionShort": "Get your Spring applications running in the cloud, specifically in Cloud Foundry. Learn how containers (yep, like Docker) are used in a PaaS, how to abstract app to services bindings, and about cross-site scripting and session state caching.",
