                                    "company": "Bitbucket",
                                    "bio": "<p>Erik has been a passionate software professional for more than 15 years, subscribing to the idea that software is a craft, not an exact science.&#160; Launching his career in his native Amsterdam in 1999, he served as chief architect for a financial market data startup until it was acquired in 2006, designing and coding both a real-time European-wide IP distribution platform for stock quotes, as well as a stock and options trading platform.<u></u><u></u></p>\n\n<p><u></u><u></u></p>\n\n<p>In 2007 he co-founded a Palo-Alto, CA based online real-time video distribution startup and acquired his first patent. In a deliberate move back to more hands-on coding, Erik joined Atlassian in 2008 and relocated to its headquarters in Sydney, Australia. Initially working on FishEye and Crucible, he later worked on various cross-product integration projects and in 2010 joined the newly formed team to run Bitbucket after its acquisition.<u></u><u></u></p>\n\n<p><u></u><u></u></p>\n\n<p>Currently based out of San Francisco, CA Erik continues to work on Bitbucket as a senior ButBucket architect, with a special interest in large-scale scalability and performance challenges. His efforts in these areas have resulted in several successful open source projects, relied on by Bitbucket as well as many other sites out there.</p>",
