                        "title": "Scaling Up: Tame Key Business Processes and Grow Fast!",
                        "sessionsMaterialUrl": "",
                        "description": "So you have a great product, have found some customers, and are ready to be wildly successful?  This session will take an in-depth look at some of the key challenges facing entrepreneurs whose products and services are starting to sell, and who are experiencing rapidly-expanding growth.  The goal of the session is to leaving you asking the right questions of the right people so you can set up appropriate, scalable business processes BEFORE your well-deserved growth turns into months-on-end of business-process fire-fighting and sleepless nights, especially for your CFO and CEO.  You’d rather get back to innovating, so why not set yourself up for graceful growth from the beginning?\nWe’ll examine common systems growing companies need such as quote-to-cash pipeline, revenue recognition and revenue forecasting, to name a few.  We’ll discuss the usual causes of problem faced by these systems, and take a look at additional problems associated with those same causes.  Then we’ll discuss data and system planning and architecture methodologies that can help you grapple with these challenges, ideally before they even occur, so that your path to success can be smoother, swifter and much more profitable.\nAlong the way we’ll discuss requirements-gathering, product- and customer-to-business-process matrices, data integration concerns, and actual business process and workflow design.\n",
                        "descriptionShort": "Dress for Success!  An overview of the key business processes involved as your company begins to take off including quote-to-cash pipeline, revenue recognition, revenue forecasting – and the steps you can take to keep such systems well integrated.",
                        "confRegistrationLine": "",
