                        "title": "Selling Basics for Startups",
                        "sessionsMaterialUrl": "",
                        "description": "This event has been organized specifically for startup founders and early employees who do not have robust sales backgrounds and want to learn more about effective selling techniques and best practices. The objective of the session is to help you install the fundamental building blocks of a world-class sales engine at your company. \n\nTo emerge from the early stages of building a new business, startups need to stay focused on two things: building and selling. The first is by far the most important. You can't sell what you don't ship, and if it's not built specifically with the customer's needs in mind, it'll be next to impossible to sell even with a great sales system.\n\nIn this presentation, you'll learn about common sales mistakes made by startups, how to build a buyer-centric sales process that scales, best practices for how to shorten your sales cycles and more.\n\nBENEFITS\n-Build sustainable, mutually beneficial relationships with prospects and customers\n-Uncover sales opportunities and close deals sooner\n-Establish trust by showing you’re focused on your customer’s needs\n-Develop solution-oriented value propositions\n-Learn to handle objections and move toward a close\n-Distinguish yourself from pitch-based sales\n\nCURRICULUM\n-Getting the meeting\n-Opening and sustaining dialogue\n-Listening and probing for needs\n-Uncovering key motivators\n-Eliciting commitments that lead to an identifiable close\n-Scheduling next steps",
                        "descriptionShort": "This event has been organized specifically for startup founders and early employees who do not have robust sales backgrounds and want to learn more about effective selling techniques and best practices. ",
