                        "title": "SharePoint 2013 Columns>>Content Types",
                        "sessionsMaterialUrl": "https://www.youtube.com/channel/UC7g2YHK0fJ4m_oMacH4fjow",
                        "description": "<p>Enterprise content management is one of the key features driving adoption of Microsoft's ECM Industry Standard, SharePoint Server 2013. To fully utilize its advanced features including automatic routing and disposition of documents, search over millions of documents, applications and workflow SharePoint must be configured to reflect the information architecture of the business. If you are a developer or a business user tasked with overseeing SharePoint customization this session is for you.</p>\n<p>This presentation will explain the fundamentals of columns, content types and records management in SharePoint and then quickly ramp up into a demonstration of how to implement a complete records management solution using Visual Studio and PowerShell.</p>\n<p>If you have questions prior to or following the session you are welcome to contact me through the Code Camp link or to connect with me on <a href=\"http://www.linkedin.com/in/ramonamaxwell\">LinkedIn</a>.</p>",
