                        "sessionsMaterialUrl": "https://github.com/spring-projects/spring-xd/wiki",
                        "description": "Developing big data applications mostly involves leveraging the capabilities of wide range of products and make them work together. This has always been a painful point for any big data application developer. \nSpringXD (http://projects.spring.io/spring-xd/) tries to simplify these challenges by unifying all the big data use cases into a single product and thererby makes it easy to solve common big data problems such as data ingestion and export, real-time analytics, and batch workflow orchestration.\nIn this session, we will discuss the capabilities of Spring XD and I will show how to build a real world big data application using Spring XD.\n",
