                        "adminComments": "",
                        "title": "Solving Problems with Fusion",
                        "sessionsMaterialUrl": "",
                        "description": "Fusing compile-time MPL and run-time tuples, Boost.Fusion is the STL of the meta-programming world. It provides the machinery behind several Boost libraries and has become a common element in my own source.\n\nIn this session we will explore the Boost.Fusion library and some real-world use-cases. Specifically, we will be looking at examples where Fusion was employed to simplify library interfaces, provide declarative user experiences, and create efficient and non-intrusive type handling.\n\nAttendees will walk away with a working understanding of Boost.Fusion and several practical usage patterns. Come and learn how to integrate into your own source the library that labors behind the scene in Boost.Spirit, Boost.Xpressive, Boost.Geometry, Boost.Accumulators, odeint, Boost.Proto, Boost.Phoenix, and Boost.MSM.",
                        "descriptionShort": "C++11 has standardized tuples in the language; however, they leave much to be desired. Working with heterogeneous containers in a generic fashion can require above average template meta-programming skills. See what Fusion can do for you! ",
                        "confRegistrationLine": "",
