                        "title": "Synthesizing an Optimized Application Specific OS for your IoT Device",
                        "sessionsMaterialUrl": "http://www.zeidman.biz/CodeCamp/SynthOS%20Presentation.pdf",
                        "description": "Advances in software synthesis can automatically create a very fast, low footprint, highly secure operating system based on the application requirements. Instead of the traditional approach of the applications conforming to the OS, now the OS can be determined by the applications. OS synthesis can also rearrange and optimize existing code to meet specific timing constraints on a particular hardware platform. The resulting application specific operating system (ASOS) has strengthened security, increased reliability, lower hardware costs, reduced debug time, and minimized memory footprint, all of which are critical to devices connected to the Internet of Things.",
