                        "title": "TCP/IP Networking for Developers",
                        "sessionsMaterialUrl": "",
                        "description": "Learn what developers need to know about networking (The TCP/IP kind, not the Facebook kind).\n\nIn today’s world it’s rare to write an application that doesn’t rely on the network, but so few of us know how to troubleshoot networking issues. Stop wondering if it’s your code or the network, I’ll show you how to point the finger at the right culprit.\n\nWe will follow the life of an HTTP packet as it goes from your web browser to the server and back. Learn how to determine what stopped the mission of that packet and why. Was it name resolution? TCP Port availability issues? Do we need to sniff the packets to find the problem? This session will make you a better programmer regardless of the technology you are using.",
                        "descriptionShort": "Learn what developers need to know about networking (The TCP/IP kind, not the Facebook kind).",
