                        "title": "Test driving Azure Search and DocumentDB",
                        "sessionsMaterialUrl": "",
                        "description": "Andrew will cover the basics of setting up Microsoft Azure Search and DocumentDB in your Azure environment.  He will show how to generate and load data into both.  From there Andrew will walk you through an example car shopping web site that demonstrates a search first navigation experience backed by a NOSQL data store.  By the end of this talk you will walk away with a fair understanding of how to set up and configure Azure Search and DocumentDB for your applications.  You will also learn how to use faceted searches to deliver the best search results for your users.  And you will learn how to include a NOSQL implementation into your application as well as when to choose it over a relational database.",
                        "descriptionShort": "Covers setting up Azure Search and DocumentDB; generation of data into a site with a search first experience backed by NOSQL; CRUD operations in Search and DocumentDB; when to choose NOSQL over relational; faceted searches in Azure Search.",
