                        "title": "Test-Driven Development with TypeScript+Jasmine+AngularJS",
                        "sessionsMaterialUrl": "https://github.com/behappyrightnow/anagram",
                        "description": "Come with your laptops to learn and try out test-driven development for web applications using TypeScript, Jasmine and AngularJS. TypeScript provides a great way to bring the advantages of compiled languages over to the world of Javascript. We will demonstrate test-driven development by writing a simple application to unscramble Anagrams using TypeScript. Tests will be written before we write actual business logic. Then, we will wire it up with AngularJS to get some web pizzazz. We will also show how we can extend our unit testing to test AngularJS controllers. We will end with an icing of Bootstrap and you will return with a great setup for Agile Web Development.\n\nYou can attend this session as a viewer but you can also dive in and follow along. To do that, please clone this git repository before you come to our session (so you don't have to rely on Wi-fi): https://github.com/behappyrightnow/anagram",
