                        "title": "The Internet of Things (IoT) enable proactive data access from any device",
                        "sessionsMaterialUrl": "https://dl.dropbox.com/s/oj7a2yt6p1y07id/codecampIOT.pdf?dl=0",
                        "description": "The Internet of Things represents an evolution in which objects are capable of interacting with other objects. Hospitals can monitor and regulate pacemakers long distance, factories can automatically address production line issues and hotels can adjust temperature and lighting according to a guest's preferences, to name just a few examples. Furthermore, as the number of devices connected to the Internet continues to grow exponentially, your organization's ability to send, receive, gather, analyze and respond to events from any connected device increases as well. If you're a developer, you now have a hand in creating the future. IBM Bluemix, an open-standards, cloud-based platform for developer offers you all the instant services, runtimes, and infrastructure you need to push your ideas into the present.  We will discuss how you can leverage analytic services in the cloud to provide the statistical analysis capabilities, by using sample data sets.  Join us at this session where you will learn how easy it is to develop IoT applications leveraging IBM Bluemix platform. ",
