                        "title": "The REST of the story: Using ASP.NET Web API to create RESTful web services",
                        "sessionsMaterialUrl": "",
                        "description": "RESTful web services are a simple yet powerful way to expose data and services to a broad range of platforms.  For Microsoft developers, ASP.NET Web API is a fantastic foundation for building RESTful services, but its not an out-of-the-box solution.   \nIn this talk I’ll introduce you ASP.NET Web API and the foundational elements it provides for creating HTTP-based services.  I'll show you through concrete examples ways you can apply the constraints of the REST architectural style to Web API to create truly RESTful web services.  Finally I'll show you multiple examples of real-world problems that you will encounter when building RESTful services and examples of solving those problems using Web API. ",
                        "descriptionShort": "REST is are a simple way to expose data to a broad range of platforms.  ASP.NET Web API is a great foundation for REST services, but its not an out-of-the-box solution.   This talk introduces you ASP.NET Web API and building REST services using it",
