                        "title": "The Rise of Wearable Technology",
                        "sessionsMaterialUrl": "",
                        "description": "Stemming from the rapid prototyping maker movement, technology has taken a huge leap forward to begin true integrations with the human body.  From controlling physical hardware through muscle tension armbands, to heartbeat monitoring wristbands to uniquely identify a person, this year is set to produce the first in a long line of technology leading the way to truly embedded technology. We'll explore this movement and see where the future of technology integrations is leading us as a species.  ",
