                        "title": "The Self-healing, Elastic Runtime that is Cloud Foundry",
                        "sessionsMaterialUrl": "",
                        "description": "You might have heard that software is eating the world; in every industry enterprises are being challenged to bring software to their consumers faster, more frequently and with insanely great user experiences. Cloud Foundry, the leading (open source) Platform as a Service (PaaS), is designed to remove friction from the traditional application lifecycle, from dev all the way through production. At the core it exposes application and services “dial tone”, rather than infrastructure “dial tone”, scoping a broad set of capabilities such as autoscaling, dynamic routing, logging, monitoring, health management, and more, around the application. Light on slides and heavy on demo, in this session we’ll share what motivates the direction of the project, and show you how easy it is to write applications for and deploy them into this cloud runtime.",
                        "descriptionShort": "Introduction to the open source Cloud Foundry PaaS with demos, demos and more demos. Watch us deploy, scale and auto-recover crashed app instances. Learn about the operational benefits of PaaS.",
