                        "title": "Trick-or-Treat Wearable Technology",
                        "sessionsMaterialUrl": "www.RogueMaking.com",
                        "description": "Want to get into the Halloween spirit this year at Code Camp?  Tenaya is a Rogue Maker and since March 16th 2013, has been learning all about electrical engineering, microcontrollers, and wearable technology.  For Tenaya's 2nd workshop, we'll learn how to sew with conductive thread.  Add the patch you create to your costume to go trick-or-treating with LEDs lighting the way.  Make a pumpkin, cat, or ghost in felt, and feel free to make your own inspiration with other fabric.  Tenaya teaches a 3 part workshop where we 1) Design 2) Prototype, and 3) Make (sew!) Choose from 6 colors of LEDs with Tenaya's #RogueMaking Lilypad kits. More sensors and LEDs are available through the workshop as well. Rogue Making wearable tech kits will be an additional $20-$35 for take-home materials to keep. Prototyping materials, fabric, and sewing supplies provided.",
                        "descriptionShort": "Halloween Wearable Tech!  Make this your year to be seen in the dark as you Trick or Treat!  Tenaya from Rogue Making, also known as Arduino Woman, would love to help you create something fun with LEDs and conductive thread.",
