                        "title": "Understanding HTTP and REST: the road to simple, scalable web services ",
                        "sessionsMaterialUrl": "",
                        "description": "HTTP has become the de facto communication protocol for virtually all things connected to the internet. Everything from enterprise databases to the thermostat in your house can communicate via HTTP-based web services.  But how well do you really know this critical part of the internet?  Are you equipped with the knowledge needed to build apps and services that can participate? This talk is a technology agnostic deep dive into the guts of HTTP.  You will leave with a solid understanding of the fundamentals of the HTTP protocol, and how combed with the REST architectural pattern, HTTP lets you build amazingly simple and scalable web services regardless of the technology stack you’re using.  ",
                        "descriptionShort": "HTTP is the protocol for virtually all things on the internet.  Do you have the info you need to build apps and services that can participate? You will leave this session with an understanding of the HTTP protocol and how it can be combed with REST.",
