                        "title": "We Don't Need No Stinkin' Product Manager!",
                        "sessionsMaterialUrl": "http://kruszka.com/external_refs/2014_svcc/SVCC_2014-10-12_Kruszka.pptx",
                        "description": "But, then again, maybe we do.  In this age of Lean Startup and the philosophy that, in a startup the CEO is the Product Manager, most detailed product decisions end up being made by developers.  But, are these the right people to be making those choices.  As is often the case in tech and in life, the answer is a resounding \"It Depends!\"\n\nIn this talk, we'll explore a number of real-life situations that show the good, the bad, and the ugly of working with and without Product Managers.",
                        "descriptionShort": "In this talk, we'll explore a number of real-life situations that show the good, the bad, and the ugly of how Engineers deliver with and without Product Managers.  (Hint: PMs aren't always right.)",
