                        "title": "Web UI in Java with Vaadin",
                        "sessionsMaterialUrl": "http://www.slideshare.net/joonaslehtinen/vaadin-intro-at-gwtcreate",
                        "description": "Vaadin is a popular web framework that allows you to write web based user interface in Java 8 or any other JVM based language directly. Writing an application that lazily loads large amounts of data from the server, includes drag-and-drop and compelling visualizations does not require one to write any HTML or  JavaScript.\n\nThe framework is based on a server centric development model that provides the best productivity, but it also supports client-side development with the built-in GWT Java to JavaScript compiler. It also allows you to go through the abstractions and write JavaScript directly. The looks of the application is customized with SASS language using powerful Valo theme. The end result can be run in any HTML5 capable browser and deployed to any Java based server or cloud.\n\nThe presentation gives an overview to Vaadin and explains how it works. We'll show how to use the parameterized Valo themes and powerful new Grid component. The session should give you everything you need to get started building your own apps with the free Apache-licensed Vaadin.",
