                        "title": "Why & What functional programming",
                        "sessionsMaterialUrl": "",
                        "description": "As software becomes more complex, it is imperative to structure it well, to ensure that it is easy to write, debug, and provides a collection of modules that can be reused to reduce future programming costs.  Functional Programming has been around for a while, but it is gaining popularity, especially due to direct support in languages on the JVM and the CLR. Writing code in functional style is not about syntax, it is a paradigm shift.\n\nIn this presentation, using examples in F# and C#, you will learn how to write code in functional style. We will start out discussing the elements of functional programming and then look at examples of some common operations and how you can implement those in functional style.",
