                        "title": "Why Would You Integrate Solr and Hadoop? (and why would you do that?)",
                        "sessionsMaterialUrl": "http://www.slideshare.net/LucidImagination/integrating-solr-hadoop",
                        "description": "As more companies are turning to and finishing implementation of Hadoop for their storage and distributed computation needs, there comes a question on how best to expose the stored information and analytics to end-users. In this talk we discuss how Solr and Hadoop complement each other, and how to use Solr as a real-time, analytical, full-text search front-end to data stored in Hadoop.\n\nThe use cases covered are applicable to near-real time search and indexing, enterprise document search, eCommerce applications, machine/log record analysis, and financial applications, among others.",
