                        "title": "WinJS for Web Devs",
                        "sessionsMaterialUrl": "https://github.com/sedouard/winjs-svcc",
                        "description": "It’s not commonly known that WinJS was born out of the browser, and then went to Windows 8. Since then WinJS has been released for Windows 8.1, Xbox One and Windows Phone 8.1. Earlier this year WinJS has been open sourced with the mission of running on any browser of your choice. In this talk, we’ll go over how WinJS provides developers with a distinctive set of high performance, polished UI controls and the cohesive set of components and infrastructure it provides for your HTML5 web apps.",
