                        "title": "XAML Anti-Patterns",
                        "sessionsMaterialUrl": "",
                        "description": "Various incarnations of XAML, such as WPF, WinRT, and Windows Phone, represent a tremendously powerful, productive, and flexible UI development environment. However, with great power also comes great power to do things incorrectly, which leads to many projects based on XAML technologies that are in trouble in some way. In this session Markus will take a look at XAML Anti-Patterns – common solutions that end up being ineffective and counterproductive. Among the discussed patterns and techniques are things like bootstrappers, virtualization, resources, XAML itself, and much, much more. Many of the presented topics may surprise even advanced XAML developers.\n\n",
                        "descriptionShort": "In this session we look at XAML Anti-Patterns – solutions that end up counterproductive.  Among the patterns & techniques discussed are bootstrappers, virtualization, XAML itself, & more.  Topics may surprise even advanced XAML developers.\n",
